import React from 'react';
import './Resume.css';

class Gallery extends React.Component {

    render() {
        return(


                  <div class="row">
                    <div class="column left" style={background="#aaa"}>
                      <h2>Column 1</h2>
                      <p>Some text..</p>
                    </div>
                    <div class="column middle" style={background="#bbb"}>
                      <h2>Column 2</h2>
                      <p>Some text..</p>
                    </div>
                    <div class="column right" style={background="#ccc"}>
                      <h2>Column 3</h2>
                      <p>Some text..</p>
                    </div>
                  </div>
        )
    }
}

export default Gallery
